import styled from 'styled-components';

function Layout ({children}) {
    return(
        <PageWrapper>
            <Header>

            </Header>
            {children}
        </PageWrapper>
    );
}

const Header = styled.div`
    height: 80px;
    width: 100%;
`;

const PageWrapper = styled.div`

`;

export default Layout;
